import React from 'react';

const Services = () => {

    return (
        <div>
            <div id="services" style={{ height : '20vh' }}></div>

            <h1 class="text-center"> SERVICES </h1> 
            <div class="row">
                <div class="col-md-2">
                    <div class="card-default">
                        <div class="card-body" id="serv1">

                        </div>
                    </div>
                </div>
            </div>
        </div>
       
    )
}

export default Services;
